				<!--je masque les tribus ici car elle sont repetes-->
				<!--<i class="fas fa-angle-right"></i> -->
				<!--<span>{tribeName}</span>-->
				<i class="fas fa-angle-right"></i>
				<span>{fullSpeciesName}</span>
